    const  navigate =useNavigate();
    const [products ,setproducts] =useState([]);

    useEffect(()=>{
        if(!localStorage.getItem('token')){
            navigate('/login');
        }
    },[])

    useEffect(()=>{
        const url ='http://localhost:4000/getProducts';
        axios.get(url)
        .then((res)=>{
            console.log(res);
            if(res.data.products){
                setproducts(res.data.products);
